import React, {Component} from 'react'
import SignIn from './Sign-In'
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom'


class App extends Component(){

  render(){
    return(
      <div>
        <Router>
          <Routes>
            <Route  path="/" element={ <SignIn /> } />
          </Routes>
        </Router>
      </div>
    );

    }
}






export default App;
